import React from "react";
import styled from "styled-components";
const Wrapper = styled.section`
  width: 100%;
  height: 1614px;
  background-color: #f8f8f8;
  & > div {
    width: 993px;
    height: 100%;
    margin: 0 auto;
  }
`;
function Section4() {
  return (
    <Wrapper>
      <div>
        <div className="left">
          <figure>
            <img src="/assets/about-kim.svg" alt="" />
          </figure>
          <div className="title">
            김과장을 <br /> 만나면 생기는 일
          </div>
        </div>
      </div>
    </Wrapper>
  );
}

export default Section4;
